import React from 'react';
import './OptionOne.css';
import {pic1} from '../../../assets/body-info-options/index';

function OptionOne(){
    return(
        <div className='option-wrapper'>

            <div className='option-photo-large'> 
                <img src={pic1} alt=''></img>
            </div>

        </div>
    )
}

export default OptionOne;
